import{_ as a,c as t,o,ag as n}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"ALTER CONVERSION","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_CONVERSION.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_CONVERSION.md"}'),s={name:"docs/7x/ref_guide/sql_commands/ALTER_CONVERSION.md"};function i(r,e,c,l,d,p){return o(),t("div",null,e[0]||(e[0]=[n(`<h1 id="alter-conversion" tabindex="-1">ALTER CONVERSION <a class="header-anchor" href="#alter-conversion" aria-label="Permalink to &quot;ALTER CONVERSION&quot;">​</a></h1><p>Changes the definition of a conversion.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER CONVERSION &lt;name&gt; RENAME TO &lt;new_name&gt;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER CONVERSION &lt;name&gt; OWNER TO { &lt;new_owner&gt; | CURRENT_USER | SESSION_USER }</span></span>
<span class="line"><span></span></span>
<span class="line"><span>ALTER CONVERSION &lt;name&gt; SET SCHEMA &lt;new_schema&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER CONVERSION</code> changes the definition of a conversion.</p><p>You must own the conversion to use <code>ALTER CONVERSION</code>. To alter the owner, you must also be a direct or indirect member of the new owning role, and that role must have <code>CREATE</code> privilege on the conversion&#39;s schema. (These restrictions enforce that altering the owner does not do anything you could not do by dropping and recreating the conversion. However, a superuser can alter ownership of any conversion anyway.)</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name (optionally schema-qualified) of an existing conversion.</p><p>new_name : The new name of the conversion.</p><p>new_owner : The new owner of the conversion.</p><p>new_schema : The new schema for the conversion.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To rename the conversion <code>iso_8859_1_to_utf8</code> to <code>latin1_to_unicode</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER CONVERSION iso_8859_1_to_utf8 RENAME TO latin1_to_unicode;</span></span></code></pre></div><p>To change the owner of the conversion <code>iso_8859_1_to_utf8</code> to <code>joe</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER CONVERSION iso_8859_1_to_utf8 OWNER TO joe;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>ALTER CONVERSION</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_CONVERSION.html">CREATE CONVERSION</a>, <a href="./DROP_CONVERSION.html">DROP CONVERSION</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,22)]))}const u=a(s,[["render",i]]);export{m as __pageData,u as default};
